import style from "./loginform.module.css"
import {Form, Button} from 'react-bootstrap';
import React, { useEffect, useState } from "react";
import SignUpForm from "./loginform/signup.js"

function Loginform() {

    const [have_account, setAccount] = useState("");
    const [user_name, setUserName] = useState("");
    const [user_password, setUserPassword] = useState("");
    const [user_email, setUserEmail] = useState("");
    const [user_country, setUserCountry] = useState("");

    const handleChange = event => {

      };
      const handelInput= event =>{
        const target = event.target;
        const value = target.value;
        const name = target.name;

        this.setState ({
          [name]: value,
        });

      }

    return (
        <div className={style.outerDiv}>
            <div className={style.logindiv}>
            <Form className={style.formtag}  onSubmit={handelInput.bind (this)}>

                    <h1 className={style.logintitle}>Log In</h1><br/>
                    <hr/><br/><br/>
                    <Form.Label className={style.loginusername} className={style.text}>Username:</Form.Label><br/><br/>
                    <Form.Control
                        className={style.loginusernameinput} className={style.logininput}
                        type="text"
                        name="user_name"
                        placeholder="Username"
                        onChange={handleChange}
                    />
                     <Form.Label className={style.loginpassword} className={style.text}>Password:</Form.Label><br/><br/>
                     <Form.Control
                        className= {style.loginpassword} className={style.logininput}  
                        maxLength="6" 
                        placeholder="Password"
                        type="text"
                        name="user_name"
                        onChange={handleChange}
                    />
                   {/*
                    <label for="loginpassword"  className={style.loginpassword} className={style.text}>Password:</label><br/><br/>
                    <input type="password" id="loginpassword" className={style.loginpassword} className={style.logininput}  maxLength="6" placeholder="Password"/><br/><br/><br/>
                    <p className={style.loginnoaccount} id={style.youdonthaveanaccount}>You don't have an account?</p><br/><br/>

                   */}
                    <Button type="submit" className={style.loginbutton} >Log In</Button> 
                    <Button className={style.loginnoaccount} >You don't have an account?</Button><br/><br/>
                    <SignUpForm />
                </Form>          
            </div> 
        </div>
    )
}

export default Loginform;
